import logo from './foreverdao-400x400.jpg';
import './App.css';

import { Button } from '@material-ui/core';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>
          ForeverDAO
        </h1>
        <body className="App-body"><p>START END</p></body>
        <Button color="primary">Material UI Button</Button>
      </header>
    </div>
  );
}

export default App;
